import io from "socket.io-client";
import { SOCKET_ADDRESS } from "../evn";

const isDev = process.env.NODE_ENV === "development";
const socket = io(SOCKET_ADDRESS, { path: "/socket" });

socket.on("connect", function (client) {
  console.log(`Socket connected to: http://localhost:3001`);
  // socket.emit('events', { data: 'test' });
});

socket.on("disconnect", function () {
  console.log(`Socket disconnected from: http://localhost:3001`);
});

export { socket };
